import './App.css';
import CodeBlock from "./CodeBlock";

const textToRender = "Hello, world!";



function Content() {
    let elems = [];
    for (let i = 0; i < 50; ++i) {
        elems.push(<p>{i} row <br/></p>)
    }


  return (
    <div className="content">
      <h2>Main Content</h2>
      <CodeBlock text={textToRender}/>
        {elems}
      <p>This is the main content of the page.</p>
    </div>
  );
}

function Footer() {
  return (
    <footer className="footer">
      <p>Footer</p>
    </footer>
  );
}

function App() {
  return (
    <div className="app">
      <Header />
      <Content />
      <Footer />
    </div>
  );
}


export default App;
